import React from 'react';
import Nav from "./components/navbar"
import Footer from "./components/footer"
import Content from "./components/content"
import {muscles, exercises} from "./store"


function App() {
  // function sortedEx(){

  //   let sortedExercise =  
  //     return Object.entries(sortedExercise)

  // }


  console.log(exercises.reduce((exercises, exercise) => {
    let {muscles} = exercise;
    exercises[muscles] = exercises[muscles] ? [...exercise[muscles], exercise]: exercise[muscles] = [exercise]
      return exercises
    }, {}))


  return (

    <div>
      <Nav />   
      <Content />
      <Footer muscles = {muscles}/>
    </div>
  )

      }

export default App;
